def find_min_changes(n: int, m: int, a: str, b: str) -> List[int]:
    occurrences = [0] * (n - m + 2)
    for k in range(n - m + 2):
        count = 0
        for i in range(n - m + 1):
            if a[i:i + m] == b:
                count += 1
                if count > k:
                    occurrences[k] = -1
                    break
            a = list(a)
            for j in range(i, i + m):
                if a[j] != b[j - i]:
                    a[j] = b[j - i]
                    count += 1
                    if count > k:
                        occurrences[k] = -1
                        break
            a = ''.join(a)
        if count == k:
            occurrences[k] = sum(x != y for x, y in zip(a, b))
    return occurrences
